import './App.css';


function App() {
  return (
    <div className="container">
      <HeaderApp />
      <NavApp />
      <MainApp />
      <FooterApp />
    </div>
  );
}

function HeaderApp() {
  return (
    <header className="headerApp">
      <a href="#" className="headerLink">
        <img src="logo.jpeg" alt="logo" className="headerimg" />
        <h1 className="headerH1">台灣室內樂推廣協會</h1>
      </a>


    </header>
  );
}

function NavApp() {
  return (
    <nav className="navApp">
      <ul>
        <li>音樂會資訊</li>
        <li>認識我們</li>
        <li>歷史回顧</li>
        <li>4</li>
        <li>5</li>
        <li>6</li>
        <li>7</li>
        <li>8</li>
      </ul>
    </nav>
  );
}

function MainApp() {
  return (
    <main className="MainApp">
      MainApp
    </main>
  );
}

function FooterApp() {
  return (
    <footer className="footerApp">
      FooterApp
    </footer>
  );
}

export default App;
